import StartForm from '../Components/StartForm'
import { useEffect } from 'react'

const Quizz = () => {

  useEffect(data, [])

  function data(){
    fetch('https://opentdb.com/api_category.php')
    .then(resp=> resp.json())
    .then(data=> console.log(data.trivia_categories.map(item=>{
      return <StartForm 
      key={item.id}
      category={item.name}
      />
    })))   
  }

  return (
    <div>
      <StartForm/>

    </div>
  )
}

export default Quizz
